import background from "./dash.jpg";
function Dashboard() {
  return (
    <>
      <div
        className="flex bg-origin-content bg-cover bg-no-repeat bg-center bg-fixed h-96 rounded-b-lg border-b-2 "
        style={{ backgroundImage: `url(${background})` }}
      >
        <div className="w-max mx-auto h-auto self-center">
            <p className="text-white font-serif text-justify font-thin text-4xl ">Mi nombre es Billy</p>
            <p className="text-justify font-extralight">Creo paginas web y aplicaciones multiplataforma</p>
        </div>
      </div>
      <div className="w-40 p-2 flex mx-auto ">
        <button className="transition duration-150 ease-out py-2 px-4 border-2 border-greens text-black font-medium hover:-translate-y-1 bg-green hover:text-gray-50  ">
          Explorar
        </button>
      </div>
    </>
  );
}

export default Dashboard;
